INSERT INTO grammar VALUES(1,'He (adjective/adverb) reads a book. (quick)','He quickly reads a book','In this case, the correct answer is quickly');
INSERT INTO grammar VALUES(2,'Max is a (adverb/adjective) singer. ','Max is a good singer.','The correct answer is good');
INSERT INTO grammar VALUES(3,'It''s a (adverb/adjective) day today. (terrible)','It''s a terrible day today.',replace('The correct answer is terrible because only \nthe adjective fits with the sentence','\n',char(10)));
INSERT INTO grammar VALUES(4,' I (hear) a new song on the radio. (past)','I heard(hear) a new song on the radio.','This is an irregular verb, so the past tense of hear is heard');
INSERT INTO grammar VALUES(5,'They (speak) French to the waitress. (Past Tense)','They spoke(speak) French to the waitress. (Past Tense)','This is an irregular verb. The past of speak is spoke');
INSERT INTO grammar VALUES(6,'He (understand) during the class, but now he doesn''t understand. (Past)','He understood(understand) during the class, but now he doesn''t understand.','The past of the verb to understand is understood');
INSERT INTO grammar VALUES(7,'They (swim) 500m. (Past)','They swam (swim) 500m. ','The past of the verb swim is swam.');
INSERT INTO grammar VALUES(8,'We (lend) John £200. (Past)','We lent(lend) John £200.','The past of the verb lend is lent.');
INSERT INTO grammar VALUES(9,'We (fly) to Sydney.','We flew(fly) to Sydney.','The past of the verb fly is flew.');
INSERT INTO grammar VALUES(10,'The child (fall) off his bicycle.','The child fell(fall) off his bicycle.','The past of the verb fall is fell');
INSERT INTO grammar VALUES(11,'present simple or the present continuous (you/come) tonight?','are you coming','In this sentence, we should use present continuous');
INSERT INTO grammar VALUES(12,'Paul has been in a wheelchair (for/while/during) most of his life','Paul has been in a wheelchair FOR most of his life',replace('We use for + length to say How Long something happens. \nWith for, we answer he question HOW LONG.\nHow long has he been in a wheelchair?','\n',char(10)));
INSERT INTO grammar VALUES(13,'When I was a child I (hadn''t, didn''t have) a bycicle','When I was a child I didn''t have a bycicle',replace('When the verb have means ''own'', \nit does not have a negative or interrogative form. \nThe informal form have got has a negative and interrogative \nform (haven''t got/has he got?, etc.), but this form \nis only used in the present tense.','\n',char(10)));
INSERT INTO grammar VALUES(14,'How long have you (been having/had) your house by the beach?','How long have you had your house by the beach?',replace('Have (=''possess'') is a regular verb. \nWe form the present perfect of any \nregular verb with have + past participle: have had.','\n',char(10)));
INSERT INTO grammar VALUES(15,'You had to call me earlier, (hadn''t you/didn''t you)?','You had to call me earlier, didn''t you?',replace('Have to is a main verb. We need do or another auxiliary \nverb to make questions, negatives, short answers, tag questions, etc.','\n',char(10)));
INSERT INTO grammar VALUES(16,replace('I''m going to say only a few words (for not to/so as not to) \ntake too much of your time.','\n',char(10)),'I''m going to say only a few words so as not to take too much of your time.',replace('We can use to, in order to and so as to + infinitive to express purpose. \nThe negative forms are in order \nnot to and so as not to + infinitive\nWe can also use for to express purpose, \nbut we use for + noun.','\n',char(10)));
INSERT INTO grammar VALUES(17,'Nobody is perfect; (so/therefore) nobody''s decisions are perfect either.','Nobody is perfect; therefore nobody''s decisions are perfect either.',replace('In the sentence above we need a clause of result. \nWe use clauses of result to talk about the result of an action or situation. \nThe result of nobody being perfect is that nobody''s decisions are perfect either.','\n',char(10)));
INSERT INTO grammar VALUES(18,'One must think of (ourselves/oneself) in certain situations.','One must think of oneself in certain situations.',replace('We need to use oneself to \nkeep consistency with one.','\n',char(10)));
INSERT INTO grammar VALUES(19,'If someone calls, tell (him/them) I''ll be back in an hour.','If someone calls, tell them I''ll be back in an hour.',replace('Someone is singular; it means ‘he or she’ \n(individual generic person).\nIn informal English, we use they, \nthem or their to refer to one generic person who \ncould be male or female. This use is considered \nincorrect by many grammarians, \nbut it is very common, even in written language.','\n',char(10)));
INSERT INTO grammar VALUES(20,'It is very difficult to put (myself/oneself) in somebody else''s shoes.','It is very difficult to put oneself in somebody else''s shoes.',replace('We can use one as a generic pronoun, \nto mean people in general, including the speaker \nand the hearer. \nOne, you, we can be used as subject or object, \nor and they are often used in their \nreflexive form (oneself, yourself, ourselves).','\n',char(10)));
